import React from "react"

function URLInput() {
    return (
        <div>
            <form> 
                <input type="text" placeholder="Enter Long URL Here..." name="longURL"/>
                <input type="submit" value="Generate"/>
            </form>
        </div>
    )
}

export default URLInput
